import React, { useState, useEffect } from "react";
import axios from "axios";
import ReactPaginate from "react-paginate";
import { Link, useNavigate } from "react-router-dom";

const Home = () => {
  const [userData, setUserData] = useState([]);
  const getUserData = async () => {
    const response = await axios.get("http://localhost:3001/auth/getAllUsers");
    console.log("123", response.data.data);
    setUserData(response.data.data);
  };
  useEffect(() => {
    getUserData();
  }, []);

  const handleDelete = async (userID, name) => {
    console.log("called", userID, name);
    if (window.confirm(`Are you sure want to delete ${name}`)) {
      try {
        const response = await axios.get(
          "http://localhost:3001/auth/deleteUsers",
          { userID }
        );
        console.log(response.data);
        getUserData();
      } catch (error) {
        console.log(error);
      }
    } else {
    }
  };

  return (
    <section class="vh-100 gradient-custom">
      <div class="container py-5 h-100">
        <div class="row justify-content-center align-items-center h-100">
          <div class="col-12 col-lg-9 col-xl-7">
            <table class="table table-bordered">
              <thead>
                <tr>
                  {/* <th>Sr</th> */}
                  <th>Firstname</th>
                  <th>Lastname</th>
                  <th>Email</th>
                  <th>Mobile No</th>
                  <th>Birth Date</th>
                  <th>Edit</th>
                  <th>Delete</th>
                </tr>
              </thead>
              {userData.map((i) => (
                <tbody>
                  <tr>
                    {/* <td>{Number(i.length + 1)}</td> */}

                    <td>{i.firstname}</td>
                    <td>{i.lastname}</td>
                    <td>{i.email}</td>
                    <td>{i.mobileno}</td>
                    <td>{i.birthdate}</td>
                    <td>
                      <button className="btn btn-primary">Edit</button>
                    </td>
                    <td>
                      <button
                        className="btn btn-danger"
                        onClick={() => handleDelete(i._id, i.firstname)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                </tbody>
              ))}
            </table>
            <ReactPaginate
              breakLabel="..."
              nextLabel="next >"
              onPageChange={handlePageClick}
              pageRangeDisplayed={5}
              pageCount={pageCount}
              previousLabel="< previous"
              renderOnZeroPageCount={null}
            />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
